real_t acado_solve_dim32_system( real_t* const A, real_t* const b, int* const rk_perm )
{
real_t det;

int i;
int j;
int k;

int indexMax;

int intSwap;

real_t valueMax;

real_t temp;

for (i = 0; i < 32; ++i)
{
rk_perm[i] = i;
}
det = 1.0000000000000000e+00;
for( i=0; i < (31); i++ ) {
	indexMax = i;
	valueMax = fabs(A[i*32+i]);
	for( j=(i+1); j < 32; j++ ) {
		temp = fabs(A[j*32+i]);
		if( temp > valueMax ) {
			indexMax = j;
			valueMax = temp;
		}
	}
	if( indexMax > i ) {
for (k = 0; k < 32; ++k)
{
	acadoWorkspace.rk_dim32_swap = A[i*32+k];
	A[i*32+k] = A[indexMax*32+k];
	A[indexMax*32+k] = acadoWorkspace.rk_dim32_swap;
}
	acadoWorkspace.rk_dim32_swap = b[i];
	b[i] = b[indexMax];
	b[indexMax] = acadoWorkspace.rk_dim32_swap;
	intSwap = rk_perm[i];
	rk_perm[i] = rk_perm[indexMax];
	rk_perm[indexMax] = intSwap;
	}
	det *= A[i*32+i];
	for( j=i+1; j < 32; j++ ) {
		A[j*32+i] = -A[j*32+i]/A[i*32+i];
		for( k=i+1; k < 32; k++ ) {
			A[j*32+k] += A[j*32+i] * A[i*32+k];
		}
		b[j] += A[j*32+i] * b[i];
	}
}
det *= A[1023];
det = fabs(det);
acado_solve_dim32_triangular( A, b );
return det;
}

